db.payers.aggregate([
  {
    $match: {
      PAYER_ID: "0133f751-9229-3cfd-815f-b6d4979bdd6a"
    }
  },
  {
    $lookup: {
      from: "claims",
      let: {
        PAYER_REF: "$PAYER_REF"
      },
      pipeline: [
        {
          $match: {
            $expr: {
              $and: [
                {
                  $eq: ["$PRIMARY_PATIENT_INSURANCE_REF", "$$PAYER_REF"]
                },
                {
                  $exists: ["$CLAIMS_TRANSACTION"]
                }
              ]
            }
          }
        },
        {
          $unwind: "$CLAIMS_TRANSACTION"
        },
        {
          $lookup: {
            from: "patients",
            let: {
              PATIENT_ID: "$PATIENT_REF"
            },
            pipeline: [
              {
                $match: {
                  $expr: {
                    $eq: ["$PATIENT_ID", "$$PATIENT_ID"]
                  }
                }
              },
              {
                $lookup: {
                  from: "encounters",
                  let: {
                    ENCOUNTER_REF: "$ENCOUNTERS"
                  },
                  pipeline: [
                    {
                      $match: {
                        $expr: {
                          $eq: ["$_id", "$$ENCOUNTER_REF"]
                        }
                      }
                    },
                    {
                      $lookup: {
                        from: "immunizations",
                        let: {
                          IMMUNIZATION_REF: "$IMMUNIZATIONS"
                        },
                        pipeline: [
                          {
                            $match: {
                              $expr: {
                                $eq: ["$_id", "$$IMMUNIZATION_REF"]
                              }
                            }
                          }
                        ],
                        as: "immunizations"
                      }
                    }
                  ],
                  as: "encounters"
                }
              }
            ],
            as: "patients"
          }
        },
        {
          $unwind: "$patients"
        },
        {
          $unwind: "$patients.encounters"
        },
        {
          $unwind: "$patients.encounters.immunizations"
        },
        {
          $addFields: {
            "immunization_code": "$patients.encounters.immunizations.CODE"
          }
        },
        {
          $group: {
            _id: {
              immunization_code: "$immunization_code"
            },
            count: {
              $sum: 1
            }
          }
        }
      ],
      as: "claims"
    }
  },
  {
    $lookup: {
      from: "encounters",
      let: {
        PAYER_REF: "$PAYER_REF"
      },
      pipeline: [
        {
          $match: {
            $expr: {
              $and: [
                {
                  $eq: ["$PAYER_REF", "$$PAYER_REF"]
                },
                {
                  $exists: ["$IMMUNIZATIONS"]
                }
              ]
            }
          }
        },
        {
          $addFields: {
            "immunization_code": "$IMMUNIZATIONS.CODE"
          }
        },
        {
          $group: {
            _id: {
              immunization_code: "$immunization_code"
            },
            count: {
              $sum: 1
            }
          }
        }
      ],
      as: "encounters"
    }
  },
  {
    $project: {
      _id: 0,
      PAYER_ID: 1,
      payer_claims_data: {
        $setUnion: ["$claims"]
      },
      payer_encounters_data: {
        $setUnion: ["$encounters"]
      }
    }
  },
  {
    $unwind: "$payer_claims_data"
  },
  {
    $addFields: {
      _id: {
        code: "$payer_claims_data._id.immunization_code"
      },
      payer_count: "$payer_claims_data.count"
    }
  },
  {
    $group: {
      _id: 1,
      total_payer_immunizations: {
        $sum: "$payer_count"
      }
    }
  },
  {
    $unwind: "$payer_encounters_data"
  },
  {
    $addFields: {
      _id: {
        code: "$payer_encounters_data._id.immunization_code"
      },
      encounters_count: "$payer_encounters_data.count"
    }
  },
  {
    $group: {
      _id: 1,
      total_encounters_immunizations: {
        $sum: "$encounters_count"
      }
    }
  },
  {
    $addFields: {
      total_uncovered: {
        $subtract: [
          "$total_encounters_immunizations",
          "$total_payer_immunizations"
        ]
      }
    }
  },
  {
    $project: {
      _id: 0,
      PAYER_ID: 1,
      total_uncovered: 1
    }
  }
])

db.patients.aggregate([
    {
        $match: {
            FIRST: 'John',
            LAST: 'Doe'
        }
    },
    {
        $unwind: '$ENCOUNTERS'
    },
    {
        $unwind: '$ENCOUNTERS.MEDICATIONS'
    },
    {
        $match: {
            'ENCOUNTERS.MEDICATIONS.DESCRIPTION': 'Alendronic acid 10 MG Oral Tablet'
        }
    },
    {
        $group: {
            _id: '$ENCOUNTERS.MEDICATIONS.DESCRIPTION',
            MAX_STOP_DATE: {
                $max: '$ENCOUNTERS.MEDICATIONS.STOP'
            },
            MIN_START_DATE: {
                $min: '$ENCOUNTERS.MEDICATIONS.START'
            }
        }
    },
    {
        $project: {
            _id: 0,
            'Drug name': '$_id',
            'Days prescribed': {
                $divide: [
                    {
                        $subtract: [
                            '$MAX_STOP_DATE',
                            '$MIN_START_DATE'
                        ]
                    },
                    86400000
                ]
            }
        }
    }
])

