db.payers.aggregate([
    {
        $match: {
            NAME: "Medicare"
        }
    },
    {
        $lookup: {
            from: "claims",
            let: {
                payer_id: "$PAYER_ID"
            },
            pipeline: [
                {
                    $match: {
                        $expr: {
                            $or: [
                                { $eq: ["$PRIMARY_PATIENT_INSURANCE_REF", "$$payer_id"] },
                                { $eq: ["$SECONDARY_PATIENT_INSURANCE_REF", "$$payer_id"] }
                            ]
                        }
                    }
                },
                {
                    $lookup: {
                        from: "encounters",
                        let: {
                            claim_id: "$CLAIM_ID"
                        },
                        pipeline: [
                            {
                                $match: {
                                    $expr: {
                                        $eq: ["$ENCOUNTER_ID", "$$claim_id"]
                                    }
                                }
                            },
                            {
                                $unwind: "$IMMUNIZATIONS"
                            }
                        ],
                        as: "immunizations"
                    }
                },
                {
                    $unwind: "$immunizations"
                },
                {
                    $group: {
                        _id: null,
                        total_immunizations: {
                            $sum: 1
                        }
                    }
                }
            ],
            as: "claim_immunizations"
        }
    },
    {
        $unwind: "$claim_immunizations"
    },
    {
        $addFields: {
            uncovered_immunizations: {
                $multiply: [
                    "$claim_immunizations.total_immunizations",
                    {
                        $cond: {
                            if: [
                                { $eq: ["$COVERED_IMMUNIZATIONS", null] },
                                "$$REMOVE"
                            ],
                            then: 1,
                            else: {
                                $subtract: [
                                    1,
                                    {
                                        $divide: ["$COVERED_IMMUNIZATIONS", "$UNCOVERED_IMMUNIZATIONS"]
                                    }
                                ]
                            }
                        }
                    }
                ]
            }
        }
    },
    {
        $project: {
            _id: 0,
            uncovered_immunizations: 1
        }
    }
])

