db.patients.aggregate([
    {
      $unwind: "$ENCOUNTERS"
    },
    {
      $lookup: {
        from: "providers",
        localField: "ENCOUNTERS.PROVIDER_REF",
        foreignField: "PROVIDER_ID",
        as: "provider"
      }
    },
    { $unwind: "$provider" },
    {
      $lookup: {
        from: "organizations",
        localField: "provider.ORGANIZATION_REF",
        foreignField: "ORGANIZATION_ID",
        as: "organization"
      }
    },
    { $unwind: "$organization" },
    {
      $match: {
        "ENCOUNTERS.PROCEDURE_CODE": { $eq: 161534003 }, 
        "ENCOUNTERS.STOP": { $lt: new Date() }
      }
    },
    {
      $project: {
        _id: 0,
