db.patients.aggregate([
  {
    $lookup: {
      from: "encounters",
      let: {
        PATIENT_ID: "$PATIENT_ID"
      },
      pipeline: [
        {
          $match: {
            $expr: {
              $eq: ["$PATIENT_ID", "$$PATIENT_ID"]
            }
          }
        },
        {
          $lookup: {
            from: "claims",
            let: {
              ENCOUNTER_ID: "$ENCOUNTER_ID"
            },
            pipeline: [
              {
                $match: {
                  $expr: {
                    $eq: ["$ENCOUNTER_ID", "$$ENCOUNTER_ID"]
                  }
                }
              },
              {
                $lookup: {
                  from: "payer_transitions",
                  let: {
                    PRIMARY_PATIENT_INSURANCE_REF: "$PRIMARY_PATIENT_INSURANCE_REF"
                  },
                  pipeline: [
                    {
                      $match: {
                        $expr: {
                          $eq: ["$_id", "$$PRIMARY_PATIENT_INSURANCE_REF"]
                        }
                      }
                    },
                    {
                      $project: {
                        _id: 0,
                        PAYER_REF: 1
                      }
                    }
                  ],
                  as: "PT"
                }
              },
              {
                $unwind: "$PT"
              },
              {
                $match: {
                  "PT.PAYER_REF": new ObjectId("df166300-5a78-3502-a46a-832842197811")
                }
              }
            ],
            as: "claimsData"
          }
        },
        {
          $unwind: "$claimsData"
        },
        {
          $addFields: {
            PAYER_COVERED: {
              $cond: {
                if: {
                  $eq: ["$claimsData.PAYER_COVERAGE", null]
                },
                then: 0,
                else: 1
              }
            }
          }
        },
        {
          $replaceRoot: {
            newRoot: "$claimsData"
          }
        },
        {
          $project: {
            _id: 0,
            PAYER_COVERED: 1
          }
        }
      ],
      as: "encountersData"
    }
  },
  {
    $unwind: "$encountersData"
  },
  {
    $group: {
      _id: null,
      count: {
        $sum: "$encountersData.PAYER_COVERED"
      }
    }
  },
  {
    $project: {
      _id: 0,
      count: 1
    }
  }
])

