db.patients.aggregate([
    {
        $lookup: {
            from: "claims",
            let: {
                patient_id: "$PATIENT_ID"
            },
            pipeline: [
                {
                    $match: {
                        $expr: {
                            $eq: ["$PRIMARY_PATIENT_INSURANCE_REF", "$$patient_id"]
                        }
                    }
                },
                {
                    $lookup: {
                        from: "payer_transitions",
                        let: {
                            payer_ref: "$PAYER_REF"
                        },
                        pipeline: [
                            {
                                $match: {
                                    $expr: {
                                        $eq: ["$PAYER_REF", "$$payer_ref"]
                                    }
                                }
                            },
                            {
                                $lookup: {
                                    from: "payers",
                                    let: {
                                        payer_ref: "$PAYER_REF"
                                    },
                                    pipeline: [
                                        {
                                            $match: {
                                                $expr: {
                                                    $eq: ["$_id", {
                                                            $toObjectId: "$$payer_ref"
                                                        }
                                                    ]
                                                }
                                            }
                                        },
                                        {
                                            $project: {
                                                NAME: 1,
                                                _id: 0
                                            }
                                        }
                                    ],
                                    as: "payer"
                                }
                            }
                        ],
                        as: "payer_transition"
                    }
                },
                {
                    $unwind: "$payer_transition"
                },
                {
                    $lookup: {
                        from: "claim_transactions",
                        let: {
                            claim_id: "$CLAIM_ID"
                        },
                        pipeline: [
                            {
                                $match: {
                                    $expr: {
                                        $eq: ["$CLAIM_ID", "$$claim_id"]
                                    }
                                }
                            },
                            {
                                $match: {
                                    TYPE: "MEDICATION"
                                }
                            }
                        ],
                        as: "claim_transaction"
                    }
                }
            ],
            as: "claims"
        }
    },
    {
        $unwind: "$claims"
    },
    {
        $group: {
            _id: "$claims.payer_transition.payer.NAME",
            UNCOUNTED_MEDICATIONS: {
                $sum: 1
            }
        }
    },
    {
        $match: {
            _id: "b046940f-1664-3047-bca7-dfa76be352a4"
        }
    },
    {
        $project: {
            _id: 0,
            UNCOUNTED_MEDICATIONS: 1
        }
    }
])

